import React from 'react';
import { Link } from 'react-router-dom';

export default function About() {
    return (
        <div>
           <nav>
            <ul>
                <li>
                    <Link to="/about-me">About</Link>
                </li>
            </ul>
           </nav>
        </div>
      );
}
